import com.eviware.soapui.support.XmlHolder
import jxl.*
def sku,name,price
//if i want to know the pathnof my excel sheet

def filepath="C:\\Project\\Product Data.xls"

//i am putting my path in variable called my file
File myfile=new File(filepath)
//excel contains two things //workbook//sheet
Workbook wb=Workbook.getWorkbook(myfile)
//i want to fetch the sheet
Sheet sh=wb.getSheet("Sheet1")
def row=sh.getRows().toInteger()
def column=sh.getColumns().toInteger()
for(def i=1;i<row;i++){
	for(def j=0;j<column;j++){
		if(j==0){
			sku=sh.getCell(j,i).getContents()
		}
		else if(j==1){
			name=sh.getCell(j,i).getContents()
		}
		else {
			price=sh.getCell(j,i).getContents()
		}

	}

def tc = testRunner.testCase.testSuite.project.testSuites["Create Product Repository"].testCases["Add Product"]
tc.testSteps['ProductAdd'].setPropertyValue("sku",sku)
tc.testSteps['ProductAdd'].setPropertyValue("name",name)
tc.testSteps['ProductAdd'].setPropertyValue("price",price)
def runner = tc.run(null,false)
log.info "$runner.status"
log.info "$runner.timeTaken"



log.info "sku"+ sku
log.info "name"+ name
log.info "price"+ price

def tstepCreateProduct=tc.testSteps['Create Product'].getPropertyValue('response')
def holderCreateProduct= new XmlHolder(tstepCreateProduct)
def idvalueCreateProduct = holderCreateProduct.getNodeValue("//*:id")
log.info "The Product In Create Id Is:$idvalueCreateProduct"

def tstepProductById =tc.testSteps['Get Product By Id'].getPropertyValue('response')
def holderProductById= new XmlHolder(tstepProductById)
def idvalueProductById = holderProductById.getNodeValue("//*:id")
log.info "The Product In Get Product Id Is:$idvalueProductById"
assert idvalueCreateProduct==idvalueProductById

def tstepAllProduct =tc.testSteps['Get All Products'].getPropertyValue('response')
def holderAllProduct= new XmlHolder(tstepAllProduct)
//the service provides response of list of customers and i am trying to count the list of Products
def nodeCount=holderAllProduct.getNodeValue("count(//result/items/item/id)")
log.info "The Total Products Added Are"+ nodeCount

def tstepDeleteProduct =tc.testSteps['Delete product By Id'].getPropertyValue('response')
def holderDeleteProduct= new XmlHolder(tstepDeleteProduct)
def idvalueDeleteProduct = holderDeleteProduct.getNodeValue("//*:result")
log.info "The Product with Id $idvalueCreateProduct Has Been Deleted :$idvalueDeleteProduct"

def tstepCheckProductById =tc.testSteps['Check Product By Id'].getPropertyValue('response')
def holderCheckProductById= new XmlHolder(tstepCheckProductById)
def idvalueCheckProductById = holderCheckProductById.getNodeValue("//*:Text")
log.info "idvalueCheckProductById" +idvalueCheckProductById


}
